import { Link } from "react-router-dom";
import "../css/navigation.css";

const Navigation = () => {
  return (
    <nav>
      <header></header>
      <ul className="nav_links">
        <Link to="/brand">
          <li>brands</li>
        </Link>
        <Link to="/best20">
          <li>best20</li>
        </Link>
      </ul>
    </nav>
  );
};

export default Navigation;
